import { configureStore } from "@reduxjs/toolkit";
import trainingManagerReducer from "../redux/training-manager/trainingManagerSlice";
import loginManagerReducer from "../redux/login/loginSlice";

export const store = configureStore({
  reducer: {
    trainingManager: trainingManagerReducer,
    loginManager: loginManagerReducer,
  },
});
